css:
@-moz-document domain("ibm-js.github.io") {
body {
  background: #333;
  color: #fff;
}

iframe {
  background: #fff;
  color: #000;
}

.box, .header, .jumbotron, .navbar {
  background: #111;
}

.header {
  border-radius: 6px;
  padding: 8px 32px 24px 32px;
}

.navbar-default {
  border-color: #333;
}
    
.navbar-default .navbar-nav > .active > a,
.navbar-default .navbar-nav > .active > a:hover {
  background: #333 none;
  color: #fff;
}
    
.navbar-default .navbar-nav > li > a:hover {
  color: #fff;
}
}
